  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Canaan
  Valley National Wildlife Refuge outlines Refuge accomplishments during the 2005
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses the master plan and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, and volunteer programs
  is given. Habitat management is also covered; subjects include wetlands, forests,
  and pest control. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, fisheries resources, and marking and bird banding.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, trapping, and law enforcement. The equipment and facilities
  section of the report provides information about new construction and rehabilitation\",\n\t\"license_title\":
